const MakeName = ({ data, handleClick }) => {
    console.log(data)
  if(data.length===0)
    return (
     <></>
    )
    else  
  data.map((baby) => {
    console.log(baby.name)
    return (
      <span
        className={baby.sex === 'f' ? 'girl' : 'boy'}
        onClick={() => {
          handleClick(baby)
        }}
      >
        {baby.name}
      </span>
    )
  })
}

